import React from 'react';

type MaintenanceProps = {
  maintenance: {
    id: string;
    monthlyFee: number;
    description: string;
  };
};

const MaintenanceItem: React.FC<MaintenanceProps> = ({ maintenance }) => {
  return (
    <div>
      <h3>ID: {maintenance.id}</h3>
      <p>Monthly Fee: {maintenance.monthlyFee}</p>
      <p>Description: {maintenance.description}</p>
    </div>
  );
};

export default MaintenanceItem;
